import React from "react";

const CardMoreProjects = (props) => {
  const { title, link, conference } = props;
  return (
    <>
      <section>
        <div className="box box_shadow">
          <div className="title_content d_flex">
            <div className="title">
              <h1>Paper Title:</h1>
              <span> {title}</span>
              <h4>Conference: {conference}</h4>
            </div>
            <div className="gpa">
              <button className="btn_shadow2">
                <a href={link}>
                  <i className="fab fa-researchgate"></i> Read
                </a>
              </button>
            </div>
          </div>
          <hr />
        </div>
      </section>
    </>
  );
};

export default CardMoreProjects;
